VALUES ('7613312030363', 'Knäckebrot 5-korn', '„andestens haltbar bis: 0205.2018 Charge: NFKA3-373123 Knickebrot 5-Korn Zutaten: Weizenvollkornme/ll \'PA, Leinsaat, 10%, Roggenvollkornmehl , Kürbiskerne, Haferflocken, 5%, Gerstenvollkornrnehl 5%, Sonnen - blufienkerne, natives Olivenôl extra, Sesam, Meersalz, Dinkelmehl 1%, Roggensaucrteig gelibcknet, Hefe, Gerstenmalzextrakl. Kann enthalten: Milch. Pain croustillant avec 5 céréales de blé complète 30%, graines de lin, farine d\'épeautre complète 10%, farine complète de seigle 7%, graines de courge, flocons d\'avoine, farine d\'avoinecomplète 5%, farine d\'orge complète 5%, graines de tournesol, huile d\'olive extra vferge, sésame, sel marin, farine d\'épeautre 1%, levain de seigle déshydraté, levure, extrait de malt d\'orge. Veut contenir: lait. Pane croccante di 5 cereali Ingredientl: farina di frumento integrale 30%, semi dil lino, farina di spelta integrale 10%, farina integrale di segale 7%, semi di zucca, fiocchi d\'avena, farina d\'avena I ItegralE 5%, farina d\'orzo integrale 5%, semi di girasole, olio d\'oliva extra vergine, sesamo, sale marino, farina di spelta 1%i pasta acida dl segale disidratata, lievito, estratto di rnalto d\'orzo. Può contenere: latte. Vor Warme geschützt und trocken lagern. I Conserver à l\'abri de la chaleur et au sec.', 'https://static.openfoodfacts.org/images/products/761/331/203/0363/front_fr.7.400.jpg', '18', '3', '48', '1', '11', '16', '2.3', '0.905511811023622', '', '0');

